import React, { useEffect, useState } from "react";
import { Nav } from "react-bootstrap";
import { Customer } from "./section/Customer";
// Styles
import "./app.scss";

// Components
import Header from "./components/Header";
import Footer from "./components/Footer";

function App() {
  return (
    <div className="app">
      <Header />
      <Nav variant="pills" defaultActiveKey="/home">
        <Nav.Item>
          <Nav.Link href="/admin/home"></Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link href="/admin/orders">
            orders
          </Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link href="/admin/customers">
            customers
          </Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link href="/admin/suppliers">
            suppliers
          </Nav.Link>
        </Nav.Item>      
      </Nav>
      <Customer />
      <Footer />
    </div>
  );
}

export default App;
